export interface WidgetBootstrap {
    /**
     * The class or ID selector of the HTML element for the widget.
     * Will use the first instance of the given selector found if multiple exist.
     */
    selector: string;
    /**
     * Configuration options for the widget.
     */
    config?: {};
    /**
     * Event callback functions for the widget.
     */
    events?: {};
    /**
     * Display text for the widget.
     */
    displayText?: {};
}
